  false,\n\t\"url\": null,\n\t\"notes\": \"Baseline (1961-1990) average annual temperature
  in and projected change in temperature for for the northern portion of Alaska. The
  Alaska portion of the Arctic LCC's terrestrial boundary is depicted by the black
